import Vue from 'vue';
import Router from 'vue-router';
import RecipeList from '../components/RecipeList.vue'; // Adjust the path as necessary
import RecipeDetail from '../components/RecipeDetail.vue'; // Adjust the path as necessary

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/',
      name: 'RecipeList',
      component: RecipeList
    },
    {
      path: '/recipe/:id',
      name: 'RecipeDetail',
      component: RecipeDetail,
      props: true
    }
  ]
});
